package com.raydya;

import org.junit.Assert;
import org.junit.Test;

public class IsSubsequenceTest {
    @Test
    public void test1() {
        final IsSubsequence solution = new IsSubsequence();
        final boolean subsequence = solution.isSubsequence("abc", "ahbgdc");

        Assert.assertTrue(subsequence);
    }

    @Test
    public void test2() {
        final IsSubsequence solution = new IsSubsequence();
        final boolean subsequence = solution.isSubsequence("axc", "ahbgdc");

        Assert.assertFalse(subsequence);
    }

    @Test
    public void test3() {
        final IsSubsequence solution = new IsSubsequence();
        final boolean subsequence = solution.isSubsequence("", "ahbgdc");

        Assert.assertTrue(subsequence);
    }

    @Test
    public void test4() {
        final IsSubsequence solution = new IsSubsequence();
        final boolean subsequence = solution.isSubsequence("leeeeetcode", "");

        Assert.assertTrue(subsequence);
    }
}
